import React, { useState } from 'react';
import logo from '../Images/logo.png';

const Navbar = () => {
  const [showDropdown, setShowDropdown] = useState(false);

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      const navbarHeight = 80;
      const elementPosition = element.offsetTop - navbarHeight;
      window.scrollTo({
        top: elementPosition,
        behavior: 'smooth'
      });
    }
  };

  return (
    <nav style={{ 
      position: 'fixed', 
      top: '10px', 
      width: '100%', 
      backgroundColor: 'transparent', 
      zIndex: 9999,
      pointerEvents: 'auto'
    }}>
      <div style={{ 
        maxWidth: '1200px', 
        margin: '0 auto', 
        padding: '0 16px',
        display: 'flex',
        alignItems: 'center',
        height: '64px'
      }}>
        <div style={{ flex: '0 0 auto' }}>
          <img 
            src={logo} 
            alt="MOE" 
            style={{ height: '48px', width: 'auto', cursor: 'pointer' }}
            onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
          />
        </div>

        <div style={{ 
          flex: '1',
          display: 'flex', 
          justifyContent: 'center',
          alignItems: 'center', 
          gap: '32px' 
        }}>
          <button
            onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
            style={{
              background: 'none',
              border: 'none',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              padding: '12px 16px',
              userSelect: 'none'
            }}
          >
            HOME
          </button>

          <div style={{ position: 'relative' }}>
            <button
              onClick={() => setShowDropdown(!showDropdown)}
              style={{
                background: 'none',
                border: 'none',
                color: 'white',
                fontSize: '14px',
                fontWeight: '500',
                cursor: 'pointer',
                padding: '12px 16px',
                userSelect: 'none'
              }}
            >
              PROJECTS ▶
            </button>

            {showDropdown && (
              <div style={{
                position: 'absolute',
                top: '100%',
                left: '0',
                backgroundColor: 'transparent',
                padding: '8px 0',
                minWidth: '180px',
                marginTop: '8px',
                zIndex: 1001
              }}>
                <button
                  onClick={() => {
                    setShowDropdown(false);
                    scrollToSection('residential');
                  }}
                  style={{
                    width: '100%',
                    background: 'none',
                    border: 'none',
                    padding: '12px 16px',
                    textAlign: 'left',
                    cursor: 'pointer',
                    fontSize: '14px',
                    color: 'white'
                  }}
                  onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
                  onMouseLeave={(e) => e.target.style.color = 'white'}
                >
                  Residential
                </button>
                <button
                  onClick={() => {
                    setShowDropdown(false);
                    scrollToSection('commercial');
                  }}
                  style={{
                    width: '100%',
                    background: 'none',
                    border: 'none',
                    padding: '12px 16px',
                    textAlign: 'left',
                    cursor: 'pointer',
                    fontSize: '14px',
                    color: 'white'
                  }}
                  onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
                  onMouseLeave={(e) => e.target.style.color = 'white'}
                >
                  Commercial
                </button>
                <button
                  onClick={() => {
                    setShowDropdown(false);
                    scrollToSection('school');
                  }}
                  style={{
                    width: '100%',
                    background: 'none',
                    border: 'none',
                    padding: '12px 16px',
                    textAlign: 'left',
                    cursor: 'pointer',
                    fontSize: '14px',
                    color: 'white'
                  }}
                  onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
                  onMouseLeave={(e) => e.target.style.color = 'white'}
                >
                  School
                </button>
                <button
                  onClick={() => {
                    setShowDropdown(false);
                    scrollToSection('interior');
                  }}
                  style={{
                    width: '100%',
                    background: 'none',
                    border: 'none',
                    padding: '12px 16px',
                    textAlign: 'left',
                    cursor: 'pointer',
                    fontSize: '14px',
                    color: 'white'
                  }}
                  onMouseEnter={(e) => e.target.style.color = '#9ca3af'}
                  onMouseLeave={(e) => e.target.style.color = 'white'}
                >
                  Interior
                </button>
              </div>
            )}
          </div>

          <button
            onClick={() => scrollToSection('about')}
            style={{
              background: 'none',
              border: 'none',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              padding: '12px 16px',
              userSelect: 'none'
            }}
          >
            ABOUT
          </button>

          <button
            onClick={() => scrollToSection('contact')}
            style={{
              background: 'none',
              border: 'none',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              padding: '12px 16px',
              userSelect: 'none'
            }}
          >
            CONTACT
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
